Kitty Pride &amp; Wolverine 01-06 (1984-1985|Digital|Minutemen-FactorX)

Promotional info for the collected edition -&quot;Kitty travels to Japan to help her father and ends up face-to-face with the granddaddy of all ninjas, Ogun! The man in the dire mask is dead-set on remaking Chicago's favorite mutant teen into an intangible assassin! But Ogun's plans for Kitty's future pale before the role he played in Wolverine's past, and the clawed Canadian vows to bring down his former teacher even if it means his death...or Kitty's!

Thanks to Minutemen-FactorX for these new digital rips. Please seed and enjoy. 

